  render() {
    return <div>welcome to QA</div>;
  }
}

export default class Btn extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <>
        <BrowserRouter>
          <Link to="/reactCourse">My Courses</Link>
          <Route path="/reactCourse" component={QA}></Route>
        </BrowserRouter>
      </>
    );
  }
}
